var wSignUpForm = angular.module("wSignUpForm",[]);

wSignUpForm.controller( "wSignUpFormController", function( $scope ) {
    var dq = new DataQuery( 'qGetCountries' );
    dq.execute().
    	done( function() {
    		$scope.$apply(function() {
    			$scope.countries = dq.getData();
    		});
	});

	var dq1 = new DataQuery( 'qUsaStates' );
    dq1.execute().
    	done( function() {
    		$scope.$apply(function() {
    			$scope.states = dq1.getData();
    		});
	});


});
